const t=JSON.parse('{"key":"v-01c67b36","path":"/tools/ieda-tools/icts.html","title":"iCTS-时钟树综合","lang":"zh-CN","frontmatter":{"title":"iCTS-时钟树综合","order":6},"headers":[{"level":2,"title":"一、概述","slug":"一、概述","link":"#一、概述","children":[{"level":3,"title":"约束","slug":"约束","link":"#约束","children":[]},{"level":3,"title":"时序模型","slug":"时序模型","link":"#时序模型","children":[]},{"level":3,"title":"目标","slug":"目标","link":"#目标","children":[]}]},{"level":2,"title":"二、多时钟平衡","slug":"二、多时钟平衡","link":"#二、多时钟平衡","children":[]},{"level":2,"title":"三、支持扩展","slug":"三、支持扩展","link":"#三、支持扩展","children":[{"level":3,"title":"多缓冲器类型","slug":"多缓冲器类型","link":"#多缓冲器类型","children":[]},{"level":3,"title":"聚类降低规模","slug":"聚类降低规模","link":"#聚类降低规模","children":[]},{"level":3,"title":"机器学习模型","slug":"机器学习模型","link":"#机器学习模型","children":[]}]}],"git":{"createdTime":1696672932000,"updatedTime":1719138368000,"contributors":[{"name":"myyerrol","email":"myyerrol@126.com","commits":2},{"name":"Xingquan-Li","email":"fzulxq@gmail.com","commits":1}]},"readingTime":{"minutes":3.28,"words":983},"filePathRelative":"tools/ieda-tools/icts.md","localizedDate":"2023年10月7日","excerpt":"<h2> 一、概述</h2>\\n<p>当前iCTS支持在给定约束下进行时钟树构建，目前iCTS以DME和Slew-Aware为基本框架，融合多类约束进行时钟树设计，由于DME的自底向上过程中无法获取上游Slew信息，<br>\\n在下游的链式传播将带来较大误差，iCTS在引入时序后向传播方法，在缓冲插入阶段进行线网级别的时序传播，矫正线网负载单元的插入时延。<br>\\niCTS采用较为准确的时序模型进行时序信息的估算与传播，以最小设计成本为目标进行时钟树构建。</p>\\n<h3> 约束</h3>\\n<p>iCTS可支持约束如下表所示，其中约束名称与Config参数名称对应</p>\\n<table>\\n<thead>\\n<tr>\\n<th style=\\"text-align:center\\">约束名称</th>\\n<th style=\\"text-align:center\\">约束等级</th>\\n</tr>\\n</thead>\\n<tbody>\\n<tr>\\n<td style=\\"text-align:center\\">skew_bound</td>\\n<td style=\\"text-align:center\\">Hard</td>\\n</tr>\\n<tr>\\n<td style=\\"text-align:center\\">max_buf_tran</td>\\n<td style=\\"text-align:center\\">Hard</td>\\n</tr>\\n<tr>\\n<td style=\\"text-align:center\\">max_sink_tran</td>\\n<td style=\\"text-align:center\\">Hard</td>\\n</tr>\\n<tr>\\n<td style=\\"text-align:center\\">max_cap</td>\\n<td style=\\"text-align:center\\">Soft</td>\\n</tr>\\n<tr>\\n<td style=\\"text-align:center\\">max_fanout</td>\\n<td style=\\"text-align:center\\">Hard</td>\\n</tr>\\n<tr>\\n<td style=\\"text-align:center\\">max_length</td>\\n<td style=\\"text-align:center\\">Soft</td>\\n</tr>\\n</tbody>\\n</table>","copyright":{"author":"iEDA","license":"GPL-3.0"}}');export{t as data};
